import styled from "styled-components";
import { theme } from "../styles/Theme";

export const SectionTitle = styled.h2`
  color: ${theme.colors.font};
  font-size: 50px;
  font-weight: 600;
  line-height: 152%;
  text-align: center;
  margin-bottom: 80px;
`;
